@pytest.mark.parametrize('seed, mean, expected', [*zip(SEEDS, MEANS, REGIONS)])
def test_random_uniform_distribution(seed, mean, expected):
    d = DelaunayTriangulation2D(mean, DIAMETER)
    for s in seed:
        d.add_point(s)
    assert d.voronoi() == expected
